import React from 'react'
import { Form,FormGroup,Input} from 'reactstrap';

  function AddCourse() {
  return (
     <>
     <Form>
      <FormGroup>
        <label for="userId">Course ID</label>
        <input type="text" placeholder='Enter userId Here' ></input>

      </FormGroup>
     </Form>
     </>
  )
}
export default AddCourse;
